import React from 'react';
import tailwind from 'tailwind-rn';
import FormButton from "../Form/FormButton";
import FormButton1 from "../Form/FormButton1";
import FormButton0 from "../Form/FormButton0";
import FormButton2 from "../Form/FormButton2";
import * as actions from "../../Actions/medicalService";
import { connect } from "react-redux";
import { StyleSheet,View, Text } from 'react-native';
//import 'localstorage-polyfill';
import { medicalService } from '../../Reducers/medicalService';
import Container from '@material-ui/core/Container';
import ParticlesBg from "particles-bg";
import './home.css';

const DiagnosticDetails = (props) => {
  let config = {
        num: [4, 7],
        rps: 0.1,
        radius: [5, 40],
        life: [1.5, 3],
        v: [2, 3],
        tha: [-50, 50],
        alpha: [0.6, 0],
        scale: [.1, 0.9],
        position: "all",
        color: [ "#ff0000"],
        cross: "dead",
        random: 10
      };
      var handleSubmit = () => {
        props.removepConfDiags(props.patientList["cin"])
      }
      var handleSubmit1 = () => {
        props.removepAdmissions(props.patientList["cin"])
      }
      var handleSubmit2 = () => {
        props.removepCaracCliniques(props.patientList["cin"])
      }
      var handleSubmit3 = () => {
        props.removepExamenCli(props.patientList["cin"])
      }

      var handleSubmit4 = () => {
        props.removepExamRadio_ParaCli(props.patientList["cin"])
      }
      var handleSubmit5 = () => {
        props.removepExamBio(props.patientList["cin"])
      }
      var handleSubmit6 = () => {
        props.removepTraitement(props.patientList["cin"])
      }
      var handleSubmit7 = () => {
        props.removepExpoRisque(props.patientList["cin"])
      }
      var handleSubmit8 = () => {
        props.removepEvoluationQuo(props.patientList["cin"])
      }
      var handleSubmit9 = () => {
        props.removepEvaluationFinale(props.patientList["cin"])
      }


    return (



 <div class="big0az">

    <div class="d-flex justify-content-center  mb-3" >

    <div class="float-left d-flex p-2" >

          <Container style={{backgroundsize: "cover"}} component="main" maxWidth="xs">
            <div  >

                <div >
                    <div class="row justify-content-center">
                    <div class="col-sm-6 ">
                    <FormButton0 title="Confirmation diagnostique" onPress={() => { props.navigation.navigate("ConfirmationDiag") }} />
                    </div><div class="col-sm-6"><button class="btn lo_btn" onClick={handleSubmit}><i class="col-sm-5 fas fa-trash-alt"></i> Supprimer</button> </div>
                    </div>
                    <div class="row justify-content-center">
                    <div class="col-sm-6 ">
                    <FormButton0 title="Admission" onPress={() => { props.navigation.navigate("Admission") }} />
                    </div><div class="col-sm-6"><button class="btn lo_btn" onClick={handleSubmit1}><i class="col-sm-4 fas fa-trash-alt"></i> Supprimer</button> </div>
                    </div>
                    <div class="row justify-content-center">
                    <div class="col-sm-6 ">
                    <FormButton0 title="Caractéristiques cliniques" onPress={() => { props.navigation.navigate("CaracCliniques") }} />
                    </div><div class="col-sm-6"><button class="btn lo_btn" onClick={handleSubmit2}><i class="col-sm-4 fas fa-trash-alt"></i> Supprimer</button> </div>
                    </div>
                    <div class="row justify-content-center">
                    <div class="col-sm-6 ">
                    <FormButton0 title="Examens cliniques" onPress={() => { props.navigation.navigate("ExamenCliniques") }} />
                    </div><div class="col-sm-6"><button class="btn lo_btn" onClick={handleSubmit3}><i class="col-sm-4 fas fa-trash-alt"></i> Supprimer</button> </div>
                    </div>
                    <div class="row justify-content-center">
                    <div class="col-sm-6 ">
                    <FormButton0 title="Examens radiologiques et para-cliniques" onPress={() => props.navigation.navigate("ExamenRadioParaCli")} />
                    </div><div class="col-sm-6"><button class="btn lo_btn" onClick={handleSubmit4}><i class="col-sm-4 fas fa-trash-alt"></i> Supprimer</button> </div>
                    </div>
                    <div class="row justify-content-center">
                    <div class="col-sm-6 ">
                    <FormButton0 title="Examens biologiques" onPress={() => props.navigation.navigate("ExamBioOpen")} />
                    </div><div class="col-sm-6"><button class="btn lo_btn" onClick={handleSubmit5}><i class="col-sm-4 fas fa-trash-alt"></i> Supprimer</button> </div>
